import React from 'react';

const eventData = props => {
      console.log("gggggg");
      const rows = props.myeventData.map(x => {
        return (
          <div className='event'>
            <h1>{x}</h1>
            <h1>Garbage</h1>
          </div>
        );
      });
      return <div>{rows}</div>;

  };


class EventCard extends React.Component {
    render() {
      console.log(this.props);
      const { eventsData } = this.props;
      return <eventData myeventData={eventsData} />;
    }
  }

  export default EventCard;
